import '../node_modules/bootstrap/dist/css/bootstrap.css'


function Home()
{
    return(
        <>
        <h1>This is Owner's Home Page</h1>
            <section class="styles_job-header-container___0wLZ" id="job_header"><div class="styles_jhc__top__BUxpc"><div class="styles_jhc__jd-top-head__MFoZl"><header><h1 class="styles_jd-header-title__rZwM1" title="Core Java Developer">Core Java Developer</h1></header><div class="styles_jd-header-comp-name__MvqAI"><a href="https://www.naukri.com/gforce-consulting-solutions-jobs-careers-5658844?src=jddesktop" target="_blank" title="Gforce Consulting Solutions Careers" class="">Gforce Consulting Solutions</a><a href="https://www.ambitionbox.com/reviews/gforce-consulting-solutions-reviews?utm_campaign=jd_ratings&amp;utm_source=naukri&amp;utm_medium=desktop" title="Gforce Consulting Solutions Reviews by employees" target="_blank"><i class="ni-icon-review-star"></i><span class="styles_amb-rating__4UyFL">4.2</span><div class="styles_grey-separator__d7CuK"></div><span class="styles_amb-reviews__0J1e3">3 Reviews</span></a></div></div><div class="styles_jhc__left__tg9m8"><div class="styles_jhc__exp-salary-container__NXsVd"><div class="styles_jhc__exp__k_giM"><i class="ni-icon-bag"></i><span>3 - 6 years</span></div><span class="styles_jhc__grey-separator__2K9Aw"></span><div class="styles_jhc__salary__jdfEC"><i class="ni-icon-salary"></i><span>Not Disclosed</span></div></div><div class="styles_jhc__loc___Du2H"><i class="ni-icon-location"></i><span class="styles_jhc__location__W_pVs"><a target="_blank" href="https://www.naukri.com/jobs-in-kolkata" title=" Jobs in Kolkata">Kolkata</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-mumbai" title=" Jobs in Mumbai">Mumbai</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-delhi-ncr" title=" Jobs in New Delhi">New Delhi</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-hyderabad-secunderabad" title=" Jobs in Hyderabad/Secunderabad">Hyderabad/Secunderabad</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-pune" title=" Jobs in Pune">Pune</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-chennai" title=" Jobs in Chennai">Chennai</a>, <a target="_blank" href="https://www.naukri.com/jobs-in-bangalore" title=" Jobs in Bangalore/Bengaluru">Bangalore/Bengaluru</a></span></div></div><div class="styles_jhc__right___xFCM"><div class="styles_jhc__send-job__l7b_v"><a id="smjltButton" title="Create a Job Alert" target="_blank">Send me jobs like this</a></div></div></div><div class="styles_jhc__bottom__DrTmB"><div class="styles_jhc__jd-stats__KrId0"><span class="styles_jhc__stat__PgY67"><label>Posted: </label><span>30+ days ago</span></span><span class="styles_jhc__stat__PgY67"><label>Openings: </label><span>1</span></span><span class="styles_jhc__stat__PgY67"><label>Applicants: </label><span>454</span></span></div><div class="styles_jhc__apply-button-container__5Bqnb"><button id="reg-apply-button" class="styles_reg-apply-button__lUN1u reg-apply-button">Register to apply</button><button id="login-apply-button" class="styles_login-apply-button__quzj4 login-apply-button undefined">Login to apply</button></div></div></section>
        </>
    )
}

export default Home;
